import Command from "./Command"

const AddDocument = (...args) => {
    Command.apply(this,args);
}

AddDocument.prototype.execute = () => {
    this._middleware.addDocument(object);
}

AddDocument.prototype.unexecute = () => {
    this._middleware.removeDocument(object);
}

export default AddDocument;
